(45123, 140850, 0, 1, '散光點', '2006~2007。\r\n當年為了作業而拿當時寫的一首詩寫成歌。\r\n並做了ㄧ部動畫。\r\n\r\n這也是我生平第一首編曲並錄音的歌。\r\n原始錄音音軌因個人因素而呈現雜音過大的現象。\r\n所以就又重錄了ㄧ次。\r\n只可惜我已經沒辦法唱出跟當年一樣的東西了。', '2012-03-20 00:00:00', 2000, 0, 1, 6, '她從海上漂流並尋找\r\n一種矯揉做作的方式嘔吐\r\n例如楓葉五指般的食道擴散\r\n輻射\r\n她是一座高塔\r\n她是那位公主\r\n她必須保持一貫的姿態反胃\r\n不可忘記的是那片玫瑰皺摺蓬鬆\r\n不已花綠牽繫的裙子\r\n總會看見那個形狀般的貪婪生長在\r\n暗不見天日的一雙翩落的紅色高細跟\r\n那也是長枝葉的散落\r\n「他的菸蒂太過骯髒」　她說　「在高貴的\r\n場地需要他離間的需求」\r\n萵苣　彩球\r\n湖中央刻意營約刻造\r\n「水是一切」她說「是時候\r\n你該吃下所有我的淫賤」\r\n「我沒有童年」\r\n「而童年給了我一切」\r\n口中的一切隱隱約約\r\n那是一則　抹除的秘密\r\n專門供來自喜竊竊切切\r\n', '', 173, '', 'Azure Blighter', 'Azure Blighter', 'Azure Blighter', '', '', 0, 0, 0, '2012-03-20 00:46:41', '2015-03-12 13:51:08', '0000-00-00 00:00:00'),
