(45131, 72723, 3999, 4, '（粵語：朝花夕拾)(中文：百萬人口之中）－艾艾作曲', '', '2012-02-17 00:00:00', 2000, 0, 1, 7, '\r\n＜朝花夕拾＞\r\n粵語填詞：林凝玉 2012/05/15\r\n作曲：艾琪優 2012/03/20\r\n\r\n原中文曲名：百萬人口之中\r\n\r\n蒲公英 將花絮散草地\r\n在風中幾世紀 又到荼蘼\r\n木蘭花怎可結果\r\n就算花都開百朵\r\n綻放的過程 亦是隨風吹就紛飛\r\n\r\n可怎躲 總會遇到險阻\r\n人海種種感慨 又再彷徨\r\n庸庸碌碌怎去闖\r\n受了傷讓淚輕淌\r\n塵世的過程 像是時針滴答穿梭\r\n\r\n朝晚花到誰手\r\n誰人可永遠生於浪蕩歲月如荳蔻\r\n如何可燃燒到最後\r\n亦怕戀愛化感慨 比花瘦\r\n\r\n浮光美景怎守\r\n無人可永遠青春就像往事結著銹\r\n如蝴蝶難飛到盡頭\r\n玫瑰都頃刻變秋\r\n何為愛竟可變做愁\r\n\r\n～啦啦啦～\r\n\r\n拾起那天的花蕊 塵世 的記認\r\n如入夢境 知花都非花 是一幅掠影\r\n\r\n\r\n\r\n\r\n\r\n\r\n＜百萬人口之中＞\r\n詞：ALEX2012/03/02"\r\n曲：艾琪優2012/03/20\r\n\r\n(主歌)\r\n一個人 在他的人生中\r\n會有多少的人 擦肩而過\r\n有的是過客匆匆\r\n有的是虛假做作\r\n會不會有人 是在乎你也關心著\r\n\r\n兩個人 分開各自苦痛\r\n有多少人一樣 分手難過\r\n有的是樂在其中\r\n有的是假裝解脫\r\n會不會有人 喜怒哀樂都了解著\r\n\r\n(副歌)\r\n百萬人口之中\r\n想不加思索 完完整整呈現自我 放縱\r\n嚮往心靈的自由\r\n不被寂寞的漩渦 所淹沒\r\n\r\n百萬人口之中\r\n想不急不迫 但人往往都會錯過 犯錯\r\n累積多少的感受\r\n人情冷暖的走過\r\n有誰肯陪你到最後\r\n\r\n～啦啦啦～\r\n\r\n但沒有真正愛過 傷過 明白過\r\n如何領悟 美好的事物 曾經很清楚～嗚嗚～～～', '', 142, '', '', '', '', '', '', 0, 1, 0, '2012-03-20 02:57:57', '2015-03-12 13:51:08', '0000-00-00 00:00:00'),
