(45211, 142563, 4178, 1, '依然', '', '2012-03-20 00:00:00', 2012, 20, 0, 1, '《依然》\r\n词：toh kok seong\r\n曲：文耀\r\n编曲：ashley han\r\n\r\n多久没回到这个地方 四处景象依然旧模样\r\n对面那座熟悉的广场 曾经是我们溜达的地方\r\n\r\n那时候我们是多么平凡 偶尔窝在那家路边摊\r\n共享汤味的浓郁芬芳 日子艰苦但微笑依然\r\n\r\n时间窜改了我们模样 为追逐彼此的理想\r\n奋不顾身的往外闯荡 一样的天空却各自傲翔\r\n\r\n现在我们只能回头望 心里已经百孔千疮\r\n如果不是固执斗气对抗 我们是否会微笑依然', '', 273, '', '', '', '', 'StreetVoice', '', 0, 0, 1, '2012-03-20 19:34:36', '2013-10-07 17:20:44', '0000-00-00 00:00:00'),
(45212, 142563, 4178, 1, '笑话', '', '2012-03-20 00:00:00', 2012, 20, 0, 7, '笑话\r\n词：toh kok seong\r\n曲：文耀\r\n编曲：ashley han\r\n\r\n痛的无法自拔 却还故作潇洒\r\n还故意假装惊讶     说没听到你讲电话\r\n是否应该把谎言揭发 还是依然静静的坐下\r\n伤痛往心里压 继续配合演这  场    笑话\r\n\r\n你已选择哪个他　    把事情搞砸\r\n选了个伤害我的方法　无法自拔 逼入悬崖\r\n爱与恨在心挣扎　\r\n你已选择哪个他        心已不在吗\r\n我该放下假装和尴尬　 选择不再　婆婆妈妈\r\n装聋    作哑　\r\n你的情话 还给你吧', '', 251, '', '', '', '', 'StreetVoice', '', 0, 0, 1, '2012-03-20 19:40:40', '2013-10-07 17:20:44', '0000-00-00 00:00:00'),
(45213, 142563, 4178, 1, '时光机', '', '2012-03-20 00:00:00', 2012, 20, 0, 7, '时光机\r\n词：toh kok seong\r\n曲：文耀\r\n编曲：ashley han\r\n\r\n又是那烦死人的声铃\r\n说好别乱了 别把我吵醒\r\n随你高兴 吵闹不停\r\n昏昏沉沉 续畅游梦境\r\n\r\n小鸟叽叽喳喳在屋顶\r\n我从容以不屑 呼声回敬\r\n继续摆我的 大字型\r\n启动那回忆搜索的引擎\r\n\r\n想乘坐时光机 回到童年情景\r\n享受那一段没有烦恼 的宁静\r\n暂时抛开现实的输赢\r\n别再为这世界而生病\r\n\r\n想乘坐时光机 回播童年剧情\r\n享受那片蓝天和那片 綠草茵\r\n希望美丽画面别下映\r\n让乌云满布的人生电影 都放晴', '', 244, '', '', '', '', 'StreetVoice', '', 0, 0, 1, '2012-03-20 19:55:34', '2013-10-07 17:20:44', '0000-00-00 00:00:00'),
