(45218, 72723, 3999, 19, '黑色樂章_終_自己爭取－秉翰接招－大衛的詞', '', '2012-02-17 00:00:00', 2000, 0, 1, 7, '＜黑色樂章　終　自己爭取　Fight For Yourself＞\r\n詞：十兵衛 2012/02/15 01:08曼谷\r\n曲：pinghang秉翰 2012/03/20 9:00pm\r\n\r\n歷史的齒輪　毫不猶豫的正在運轉\r\n被送往　太平洋的另一端\r\n載著我們那艘　搖搖晃晃的破船\r\n卻諷刺的叫　拉密斯塔（La Amistad）　\r\n\r\n從南到北　美利堅的東岸\r\n是ＳPAIN註明的殖民地盤\r\n我們被換取的　只是COIN (coin請改成兩個字的中文詞)\r\n這場拍賣結束　相繼被拆散\r\n\r\n夢想自由自在　穿梭在這片藍海\r\n動人的聲音　還在等你們安排\r\n該不該　將壓抑高歌在天外\r\n會不會　醒來明天被譽為囚犯\r\n\r\n(大合唱)\r\n為自己爭取　自己要的未來\r\n雙手一挺　自由就不曾離開\r\n如果還記得　有人這樣陪伴\r\n我不會忘記　叫昆西的由來\r\n\r\n為自己爭取　原有的歸屬感\r\n抬頭挺胸　我們還是條硬漢\r\n縱使看起來　不像一般的裝扮\r\n但至少我會　對得起我的同伴\r\n\r\n橋段：\r\n自由不是別人給予\r\n是出生那天就享有的權利\r\n哪怕別人從你手中奪去\r\n為自己爭取\r\n\r\nFreedom is not given\r\nIt is our right at birth\r\nBut there are some moments\r\nwhen it must be taken\r\n\r\n夢想自由自在　穿梭在這片藍海\r\n動人的聲音　還在等你們安排\r\n該不該　將壓抑高歌在天外\r\n會不會　醒來明天被譽為典範', '', 227, '', '', '', '', '', '', 0, 1, 0, '2012-03-20 22:52:12', '2015-03-12 13:51:10', '0000-00-00 00:00:00'),
