(45224, 142645, 0, 1, '飛翔', '感情中學著成長\r\n成熟了 心胸向海洋一樣遼闊 坦然\r\n', '2011-05-09 00:00:00', 2011, 0, 1, 1, '飛翔\r\n\r\n選擇遺忘還是放棄那一瞬間\r\n決定了你我夢想繼續走向前\r\n走向黑暗的角落\r\n\r\n偷偷埋藏記憶的那片海洋\r\n有著你我共同的遼闊藍天\r\n\r\n喔海洋\r\n\r\n交織在未來的時間\r\n交錯在未來的狂想\r\n別再讓機會 流逝遺憾 笑容的純真\r\n\r\n放開手  我們學著一起飛翔\r\n這一次不再失去方向感\r\n放開手 我們試著去飛翔\r\n下一秒也許會更堅強\r\n', '', 206, '', '咪咪/霹靂', '咪咪', 'N2G', 'StreetVoice', '', 0, 1, 0, '2012-03-20 23:29:30', '2015-03-12 13:51:10', '0000-00-00 00:00:00'),
