(45246, 142645, 0, 1, '花', '新年 新希望\r\n給予自己正面積極觀\r\n相信快樂 好事就會跟著來', '2011-05-09 00:00:00', 2011, 0, 1, 1, '花\r\n\r\n\r\n花開了又謝   \r\n像希望燃了又滅\r\n我看著餘煙\r\n露出失望的臉\r\n我不曉得季節的改變\r\n牽絆著多少人的愛戀\r\n令人厭僨的瑣碎\r\n都是種考驗\r\n\r\n拋下眼淚 \r\n遠離人煙\r\n快樂過新年\r\n\r\n擦乾眼淚 \r\n遠離人煙\r\n快樂過新年\r\n\r\n拋下眼淚 \r\n遠離人煙\r\n快樂過新年\r\n\r\n拉拉拉拉拉 \r\n快樂過新年\r\n\r\n\r\n\r\n', '', 177, '', '霹靂', '霹靂', 'N2G', 'StreetVoice', '', 0, 1, 0, '2012-03-21 02:25:52', '2015-03-12 13:51:11', '0000-00-00 00:00:00'),
